import React from 'react';
import './OvensView.css'
import OvenItem from './OvenItem';

const OvensView=(props)=>{
    return(
        <div className="ovenItems" >
            <OvenItem ovenData={props.oven_status} setupData={props.setups_status}/>
        </div>
    )
};

export default OvensView;
